public IneqMesh GetIneqMesh()
{
  	var sdf = new SignedDistance("bunny.stl");
	var b = (# sdf.From(x, y, z)) ;
  
    return new IneqMesh
    {
        X0 = -35.0,
        Y0 = -10.0,
        Z0 = -10.0,
        X1 = 25.0,
        Y1 = 10.0,
        Z1 = 60.0,
        D = 1,
        Boxed = true,
        IneqTree =
          b & !(# (x+15)*(x+15) + y*y - 10)
	};
}
